    @Test
    void getDataFromLocation() {
        Mockito.when(restTemplate.getForObject(String.format(service.geoURL, currentPosData.getLocation(), currentPosData.getCountry_code(), service.apiKey), OWMGeolocation[].class)).
                thenReturn(geoData);
        Mockito.when(restTemplate.getForObject(String.format(service.airURL, currentPosData.getCoordinates().getLat(), currentPosData.getCoordinates().getLon(), service.apiKey), OWMAirPollutionList.class)).
                thenReturn(currentPreData);

        FullData data = service.getDataFromLocation(currentPosData.getLocation(), currentPosData.getCountry_code());
        assertThat(data).isEqualTo(currentPosData);
    }

